  <div className="spaceTopHome">

    <Carousel sm={12} lg={4} className="d-none d-lg-block" nextIcon="" nextLabel="">
      <Carousel.Item>
      <img
        className="d-block w-100 cardRounded "
        src={img3}
        alt="First slide"
      />
      <Carousel.Caption >
      <h3>Your Treasure Hunt Name</h3>
      <p>TITLE OF TREASURE HUNT</p>

      <LinkHeader to="/Partnerships/projecthunt">
        <Button className="customButton" onClick={projecthunt}  to="/Partnerships/projecthunt" style={{margin:'10px'}}>START HERE</Button>
      </LinkHeader>

      </Carousel.Caption>
      </Carousel.Item>


    </Carousel>


      </div>


      </Container>
      </div>


    );

}

